import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import Logo from '../pictures/Logo.png'



function Header() {
  return (
    
    <div className="container-fluid" style={{ backgroundColor: '#3d3c3c' }}>
      <div className="row align-items-center">
        <nav className="navbar navbar-expand-lg navbar-light">
          <div className="col-sm">
            <img src={Logo} className="d-inline-block align-top" alt="" style={{ height: '20%', width: '20%' }} />
          </div>
          <div className="col-sm">
            <h1 style={{ fontFamily: 'fantasy', color: '#063E25' }}>Match Mate</h1>
          </div>
          <div className="col-sm-3 d-flex justify-content-end" style={{ paddingRight: '20px' }}>
            <button type="button" className="btn me-3" style={{ backgroundColor: '#E0F0DC' }} onClick={handleShowSignin}>Sign In</button>
            <button type="button" className="btn btn-dark" onClick={handleShowSignup}>Sign Up</button>
          </div>
        </nav>
      </div>
      <SignInModal showModal={showSigninModal} setShowModal={setShowSigninModal} isOwner={isOwner} />
      <SignUpModal showModal={showSignupModal} setShowModal={setShowSignupModal} />
    </div>
  );
}

export default Header;
